import './Logement.css';

function Logement({ props }) {


  return (
    <div>
      {props.map((logement) => (
        <div className="logement-wrapper">
          <p className='adresse'>{logement.adresse}</p>
          <p className='type'>{logement.type}</p>
          <p className='surface'>{logement.surface}</p>
          <p className='price'>{logement.price}</p>
        </div>
      ))}
    </div>
  );

}

export default Logement;
